import React from "react";
import AboutUsCounter from "../../common/AboutUsCounter";
import CategoryHome2 from "./CategoryHome2";
import HeroBanner from "./HeroBanner";
import LiveAuctionArea from "./LiveAuctionArea";
import RecentNewsArea from "./RecentNewsArea";
import SopnsorArea from "./SopnsorArea";
import TestimonialSlider2 from "./TestimonialSlider2";
import UpcommingArea from "./UpcommingArea";
function HomePageTwo() {

  return (
    <>
    <HeroBanner/>
    <CategoryHome2/>
    <LiveAuctionArea/>
    <TestimonialSlider2/>
    <UpcommingArea/>
    <SopnsorArea/>
    <RecentNewsArea/>
    <AboutUsCounter/>
    </>
  );
}

export default HomePageTwo;
